import React from 'react'

class Card extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            showCard: [
                {id:0, link:""}
            ]
        };
    }
    createCard(){
        if(this.state.showCard == true){
            this.setState.
            return(
            <div className="Card" >
                <img src = {this.state.link} width="300px" height="300px"></img>
                <p>{this.state.setName}</p>
                <button onClick={this.deleteCard}>x</button>
            </div>
            )
        }
    }
    render(){
        return(
        <div className="columnRight">
            {this.state.showCard.map(showCard=><Card key ={showCard.id} link = {showCard.link} />)}
        </div>
        );
    }
}
